import React from 'react'
import '../../assets/Data/videos.json'



export default function NextVideo({ video }) {
    return (
        <div>
            {video.map( comment =>(
                    <div>
                    <image>{video.image}</image>
                    <p>{video.title}</p>
                    <p>{video.channel}</p>
                    <hr/>
                </div>
                )
                )}
        </div>
    )
}
